Script.parameter:
resthost = "https://192.168.252.3:30943";
myUserID = "itim manager";
myPassword = "Passw0rd";

	//Setup connector 
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	//Prepare call to get LTPAToken2
	myHttpConn.setParam("url",resthost + "/itim/j_security_check");
	myHttpConn.setParam("method","POST");
	myHttpConn.initialize(null);

	//Configure the call
	var httpcall = system.newEntry();
	httpcall.setAttribute("http.Content-Type","application/x-www-form-urlencoded");
	//Set body to userid/password
	httpcall.setAttribute("http.body","j_username=" + myUserID + "&j_password=" + myPassword);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request1 : " + httpcall + "\n Reply1 : " + httpReply);

//Get LTPAToken2 from the Set-Cookie set of tokens
	var myTokens = httpReply.getAttribute("http.Set-Cookie");
	for (var myToken in myTokens){
		if (myToken.startsWith("LtpaToken2=")){
			LTPAToken2 = myToken;
			task.logmsg("LTPAToken2 : " + LTPAToken2);
			break;		
		}
	}







	//Prepare call to get CSRFToken
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	myHttpConn.setParam("url",resthost + "/itim/rest/systemusers/me");
	myHttpConn.setParam("method","GET");
	myHttpConn.initialize(null);

	//Configure the call
	var httpcall = system.newEntry();
	httpcall.setAttribute("http.Cookie",LTPAToken2);
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");
	httpcall.setAttribute("http.fromISC","true");

	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request2 : " + httpcall + "\n Reply2 : " + httpReply);


	//Retrieve CSRFToken
	CSRFToken = httpReply.getString("http.CSRFToken");
	task.logmsg("CSRFToken : " + CSRFToken)

	//What other cookies ?
	myCookies = httpReply.getAttribute("http.Set-Cookie");








//do a person add
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	var httpcall = system.newEntry();
	myHttpConn.setParam("url",resthost + "/itim/rest/people");
	myHttpConn.setParam("method","POST");
	myHttpConn.initialize(null);
	httpcall.setAttribute("http.Content-Type","application/json");
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");

	httpcall.setAttribute("http.body",system.getScriptText("personAddJSON"));
/*
	This is content of personAddJSON
 	{
	  "profileName": "Person",
	  "_attributes": {
	    "sn": "Doe",
	    "cn": "John Doe"
	  },
	  "orgID": "ZXJnbG9iYWxpZD0wMDAwMDAwMDAwMDAwMDAwMDAwMCxvdT1kZW1vLGRjPWl2aWc"
	}
 *  * 
 */
	//Add LTPAToken2 to cookies received on /systemusers/me call
	myCookies.addValue(LTPAToken2);
	httpcall.setAttribute("http.Cookie",myCookies);
	httpcall.setAttribute("http.CSRFToken",CSRFToken);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request3 : " + httpcall + "\n Reply3 : " + httpReply);

//Sleep to allow the user to be created
	system.sleep(3);


//find the created user
	var mySearchCriteria = "?cn=John Doe"
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	var httpcall = system.newEntry();
	myHttpConn.setParam("url",resthost + "/itim/rest/people" + mySearchCriteria);
	myHttpConn.setParam("method","GET");
	myHttpConn.initialize(null);
	httpcall.setAttribute("http.Content-Type","application/json");
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");
	//Add cookies received on /systemusers/me call and LTPAToken2
	httpcall.setAttribute("http.Cookie",myCookies);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request4 : " + httpcall + "\n Reply4 : " + httpReply);
	myJSONResponse = fromJson(httpReply.getString("http.bodyAsString"));
	var myUser = myJSONResponse[0]._links.self.href;
	task.logmsg("myUser : " + system.base64Decode(myUser));

//lookup the created user
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	var httpcall = system.newEntry();
	myHttpConn.setParam("url",resthost + myUser);
	myHttpConn.setParam("method","GET");
	myHttpConn.initialize(null);
	httpcall.setAttribute("http.Content-Type","application/json");
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");
	//Add cookies received on /systemusers/me call and LTPAToken2
	httpcall.setAttribute("http.Cookie",myCookies);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request5 : " + httpcall + "\n Reply5 : " + httpReply);

//modify the created user
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	var httpcall = system.newEntry();
	myHttpConn.setParam("url",resthost + myUser);
	myHttpConn.setParam("method","PUT");
	myHttpConn.initialize(null);
	httpcall.setAttribute("http.Content-Type","application/json");
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");
	httpcall.setAttribute("http.body",system.getScriptText("personModifyJSON"));
/*
 * 
{
  "_attributes": {
    "givenname": "John"
  }
}
 */
	//Add cookies received on /systemusers/me call and LTPAToken2
	httpcall.setAttribute("http.Cookie",myCookies);
	httpcall.setAttribute("http.CSRFToken",CSRFToken);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request6 : " + httpcall + "\n Reply6 : " + httpReply);

//delete the created user
	myHttpConn = system.getConnector("ibmdi.HTTPClient");
	var httpcall = system.newEntry();
	myHttpConn.setParam("url",resthost + myUser);
	myHttpConn.setParam("method","DELETE");
	myHttpConn.initialize(null);
	httpcall.setAttribute("http.Content-Type","application/json");
	httpcall.setAttribute("http.accept","application/vnd.ibm.isim-v1+json");
	//Add cookies received on /systemusers/me call and LTPAToken2
	httpcall.setAttribute("http.Cookie",myCookies);
	httpcall.setAttribute("http.CSRFToken",CSRFToken);
	//Perform call
	httpReply = myHttpConn.queryReply(httpcall);
	task.logmsg("Request9 : " + httpcall + "\n Reply9 : " + httpReply);

